import React from 'react';

import Common1 from './android/Common1';


import Header from '../contact/header'
import Banner from '../contact/innerbanner'
import Footer from '../home/footer'
import Iosbanner from './Iosbanner'

const Ios = () => {
    return (
        <div>
            
            <Header/>
            <Banner/>
            <Common1/>
                
            <Iosbanner/>
            <Footer/>
        </div>
    );
};

export default Ios;
